import base64

import openai


input = """"""


def transcript(input_base_64):
    """
    Takes a base64 encoded webm file and returns a transcript of the audio using OpenAI Whisper API

    Args:
        input_base_64 (_type_): _description_
    """

    # convert base64 to audio file

    with open("audio.webm", "wb") as fh:
        fh.write(base64.decodebytes(input_base_64.encode()))
        fh.close()

    with open("audio.webm", "rb") as fh:
        response = openai.Audio.transcribe("whisper-1", fh)
        print(response)


transcript(input)
